import React from "react";
import { NavLink } from "react-router-dom";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";

const styles = {
  link: {
    textDecoration: "none",
    color: "inherit",
  },
  activeLink: {
    color: "blue",
  },
};

const Navbar = () => {
  return (
    <AppBar position="static">
      <Toolbar style={{ display: "flex", justifyContent: "space-between" }}>
        <Typography
          variant="h6"
          component={NavLink}
          to="/"
          exact
          style={{ ...styles.link, flexGrow: 1 }}
          activeStyle={styles.activeLink}
        >
          My App
        </Typography>
        <div
          style={{
            display: "flex",
            gap: "50px",
            marginRight: "60px",
          }}
        >
          <Button
            color="inherit"
            component={NavLink}
            to="/"
            exact
            style={styles.link}
            activeStyle={styles.activeLink}
          >
            Home
          </Button>
          <Button
            color="inherit"
            component={NavLink}
            to="/aboutus"
            style={styles.link}
            activeStyle={styles.activeLink}
          >
            About Us
          </Button>
          <Button
            color="inherit"
            component={NavLink}
            to="/contactus"
            style={styles.link}
            activeStyle={styles.activeLink}
          >
            Contact Us
          </Button>
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;

